response.about:
Психолог - консультант по личным вопросам.

А так же, мастер женских практик – помогаю женщинам  открыть и развить в себе:
Женственность;
Уверенность;
Внутреннею Красоту;
Найти путь своего предназначения; 
Гармонизировать жизнь;

Оказываю профессиональную помощь 
в проработке негативных /ограничивающих убеждений, помогаю найти, осознать и перенастроить. 

Работаю на основе методик общей психологии, АРП метода, Спираль, Р.Хабарда, Детализации, Гештальт терапии и собственных авторских техник.

Владею мануальными практиками коррекции тела: опорно-двигательный аппарат, висцеральная терапия.

Мастер биоэнергетической коррекции тела. 
Помогаю найти первопричины недомоганий, устранить зажимы и блоки, облегчить болевые синдромы. Общее выравнивание энергоинформационного фона. Методы БЭСТ массажа, Беленко, общие энерго-практики, а так же техники собственной разработки.

Диетолог, член Российской ассоциации диетологов. Личные консультации, разработка индивидуального рациона питания, программы коррекции веса. Комплексное ведение до результата!

Владею навыками профессиональной речи, с чем так же могу помочь.

И главное, Я Мама и любимая Женщина.))
